import React from 'react'

const Folder3 = ({name,age,city,course,Mobile}) => {
  return (
    <div style={{backgroundColor:"red"}}>
    <h1>Name: {name} </h1>
    <h1>Age: {age}</h1>
    <h1>City: {city}</h1>
    <h1>Course: {course}</h1>
    <h1>Mobile.no {Mobile}</h1>
    </div>
  )
}

export default Folder3
